        source_cte_with_users.status IN ('todo', 'in_progress') and
        forall(
            upstream_cte.upstream,
            upstream_step -> upstream_step.status == 'complete'
        ) and
        (parent_cte.parent.id IS NULL OR parent_cte.parent.status = 'complete')
    ) THEN true
    else false
